import React from "react";
import propTypes from "prop-types";
import * as Styled from "./style";

export const Size = {
  s: "12px",
  m: "14px",
  l: "18px",
};

export const Weight = {
  xs: 100,
  s: 300,
  m: 500,
  l: 700,
};

const P = ({ text = "", size = Size.m, weight = Weight.m }) => {
  const style = {
    fontSize: size,
    fontWeight: weight,
  };

  return <Styled.P style={style}>{text}</Styled.P>;
};

P.propTypes = {
  text: propTypes.string,
  size: propTypes.string,
  weight: propTypes.number,
};

export default P;
